import React, { useState } from "react";
import axios from "axios";

// styles
import { MyBody, UserTable } from "../AdminEndpoint/Admin.styles";


const AdminEndpoint = () => {


return (
    <MyBody>
            <UserTable>
      <thead>
          <tr>
            <th>Name</th>
            <th>Language</th>
            <th>Years of experience</th>
            <th>Price per hour</th>
          </tr>
            </thead>
      </UserTable>
    </MyBody>
    );
};
export default AdminEndpoint;
